import React, {useState} from 'react';
import logo from '../../assets/images/Logo.png';
import Search from './Search';

function Header() {
  const [searchResults, setSearchResults] = useState([]);
  const handleSearch = (query) => {
    // Implement your search logic here
    // Pass the query to the appropriate function to handle the search
    setSearchResults([query]);
  };

  return (
    <header>
      <nav id="navbar">
        <ul>
          <li><a href="#home">Home</a></li>
          <li><a href="#schedule">Schedule</a></li>
          <li><a href="#program">Programs</a></li>
          <li><a href="#events">Events</a></li>
          <li><a href="#news">News</a></li>
          <li><a href="#merch">Merch</a></li>
          <li><a href="#contactus">Contact Us</a></li>
          <li><img src={logo} alt="Logo" /></li>
          <l1><Search onSearch={handleSearch} /></l1> {/* Pass handleSearch as the onSearch prop */}
        </ul>
      </nav>
      <Search results={searchResults} /> {/* Pass searchResults as props to SearchResult component */}
    </header>
  );
}

export default Header;
